import React from "react";
import Crossword from "@jaredreisinger/react-crossword";
import styled from "styled-components";

const data = {
  across: {
    1: {
      clue: "one plus one",
      answer: "TWO",
      row: 0,
      col: 0,
    },
    3: {
      clue: "five plus three",
      answer: "EIGHT",
      row: 2,
      col: 2,
    },
  },
  down: {
    2: {
      clue: "three minus two",
      answer: "ONE",
      row: 0,
      col: 2,
    },
  },
};
const Container = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: flex-start;
  margin: 20px;

  .crossword {
    margin-right: 20px;
  }

  .clues {
    max-width: 200px;
  }

  /* Hide the original Across and Down labels */
  .clues > div:first-of-type > h3:first-of-type,
  .clues > div:nth-of-type(2) > h3:first-of-type {
    display: none;
  }
`;

const ClueSection = styled.div`
  margin-bottom: 20px;
  h3 {
    margin-bottom: 10px;
  }
`;

export default function UtakAtikGathukNglegena() {
  return (
    <div className="contain">
      <br />
      <h1 className="p-20 m-5 text-center">Utak Atik Gathuk Nglegena</h1>
      <br />
      <Container>
        <div className="crossword">
          <Crossword data={data} />
        </div>
        <div className="clues">
          <ClueSection>
            <h3>Horizontal</h3> {/* Custom label instead of "Across" */}
            <ul>
              <li>1: one plus one</li>
              <li>3: five plus three</li>
            </ul>
          </ClueSection>
          <ClueSection>
            <h3>Vertical</h3> {/* Custom label instead of "Down" */}
            <ul>
              <li>2: three minus two</li>
            </ul>
          </ClueSection>
        </div>
      </Container>
    </div>
  );
}
